import { AcceptButton } from "./AcceptButton.js"
import { DenyButton } from "./DenyButton.js"

export const AcceptDenyContainer = ({ requests, id, refresh }) => {

    return (
        <>
            {requests.isAccepted || requests.isDenied ?
                "" : <div>
                    <AcceptButton requests={requests} id={id} refresh={refresh} />
                    <DenyButton requests={requests} id={id} refresh={refresh} /></div>}
        </>
    )
}
